$(document).ready(function(){"use strict";const externalLinks=function(){const internalHost=[location.hostname];const protocolPattern=/^https?:\/\//i;$("a").each(function(){const href=$(this).attr("href");if(protocolPattern.test(href)){const hrefHostname=$(new URL(href)).attr("hostname");if($.inArray(hrefHostname,internalHost)===-1){$(this).attr("target","_blank");$(this).attr("rel","noopener noreferer")}}})};const init=function(){externalLinks()};init();$(document).ajaxSuccess(function(){externalLinks()})});